import React from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import "./style.css";
import ThemeProvider from "./contexts/ThemeContext";
import Home from "./pages/Home";
import Terms from "./pages/Terms"; // Importa el nuevo componente

function App() {
  return (
    <Router>
      <ThemeProvider>
        <Switch>
          <Route path="/" exact component={Home} />
          <Route path="/terminos" component={Terms} /> {/* Ruta para los términos */}
        </Switch>
      </ThemeProvider>
    </Router>
  );
}

export default App;
